exports.register = (req, res) => {

    const { data } = req.body

    if(data){
        return res.json({
            data: data,
            message: "This is post method"
        })
    }
    res.send("No data")
}

exports.login = (req, res) => {
    res.send("Login")
}

exports.getUser = (req, res) => {
    res.send("Hello Node");
}

